$(document).on("turbolinks:load",function(){$("#main-search").length&&($("#main-search").autocomplete({source:function(e,i){$.ajax({type:"GET",url:"/autocomplete",data:{query:e.term},success:function(e){i(e.suggestions),console.log(e.suggestions)}})},select:function(e,i){e.preventDefault(),$("#main-search").val(i.item.username),window.location.href="/profiles/"+i.item.id},focus:function(e,i){e.preventDefault(),$("#main-search").val(i.item.username)},minLength:1}).autocomplete("instance")._renderItem=function(e,i){return $("<a id='profile-result-"+i.id+"' href='/profiles/"+i.id+"'><li class='profile-item'><div class='ac-item-container'><div class='small-thumb-container'><img class='small-thumb' style='width: 30px; height: 30px;' src='/profile_default.png'></div><div class='item-info'><p class='username-item'>"+i.username+"</p><span class='name-item'>"+i.name+"</span></div></li></div></a>").appendTo(e)})});